// src/App.js
import React, { useEffect, useState } from 'react';
import { getTestNode } from './api';  // Import the API function

function App() {
  const [node, setNode] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchNode = async () => {
      try {
        const data = await getTestNode();
        setNode(data.node);
      } catch (err) {
        setError('Failed to fetch node');
      }
    };

    fetchNode();
  }, []);

  return (
    <div className="App">
      <h1>Graph Editor</h1>
      {error && <p>{error}</p>}
      {node ? (
        <div>
          <h2>Node Details</h2>
          <p>Label: {node.label}</p>
          <p>Position: ({node.positionX}, {node.positionY})</p>
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
}

export default App;
